import React from "react";
import '../App.css';
import Button from "../components/Button";


const Todos = () =>{
    return (
       <div className="todos_wrapper">
        <ul className="todos">
        <li>
            <input type="checbox" />
            <p>Сходить в магазин</p>
            <Button text ="Удалить Todo"/>
        </li>
        </ul>
       </div>

    )
}

export default Todos;
